import React from 'react'

const About = () => {
    return (
        <>
            <p>This is a personal project from Peter Stone.</p>
            <p><a href="https://www.linkedin.com/in/peter-stone-0017a691/">LinkedIn</a> | <a href="mailto:peter.stone.online@gmail.com">Email</a> | <a href="https://github.com/peter-g-stone/">GitHub</a></p>
        </>
    )
}

export default About
